private String getRegistryKey(ApplicationId appId, String fileName) {
  if (appId == null) {
    return this.registryBaseDir;
  }
  if (fileName == null) {
    return this.registryBaseDir + appId.toString();
  }
  return this.registryBaseDir + appId.toString() + "/" + fileName;
}
